import React from "react";

function PostedImageComponent() {
    let image = ['http://www.bhc.co.kr/upload/bhc/menu/ck20150130_470_v.jpg',
                'https://images.velog.io/images/carminchameleon/post/e62b5da0-a6f4-4d6e-845b-4db3053e19e7/image.png',
                'https://blog.kakaocdn.net/dn/criONw/btqGWTUql5w/G8HUksO7r4UMzAsZXi9LN1/img.png'
                ]

    return(
            <img style={{
            width: '100px',
            margin: 'auto'
        }} alt="chicken" src={image}></img>
    )
}

export default PostedImageComponent
